<div class="entities" style="line-height: 2.5; direction: ltr">Glucocorticoids enhance regeneration of murine olfactory epithelium . CONCLUSION : Glucocorticoid ( GC ) administration enhanced apoptotic changes in mature olfactory receptor neurons ( ORNs ) . GC administration may enhance regeneration of olfactory epithelium ( OE ) . OBJECTIVES : The mechanism underlying olfactory epithelial cells turnover involves apoptosis replaced by new ORNs . On regeneration of OE , we evaluated the apoptotic changes in OE . Our aim was to corroborate the enhancement of apoptosis of ORNs induced by GCs that are generally administered locally or systemically to patients with olfactory dysfunction . MATERIALS AND METHODS : For the in vitro study , we established cultured murine ORNs . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 acetonide was added to culture supernatants . ORNs were then cultured for another 2 weeks . In the in vivo study , triamcinolone acetonide was administered to mice 5 or 10 times . The mice were dissected 3 days after the final injection , and the olfactory regions were removed and embedded in paraffin . All samples were examined by immunohistochemical staining and the TdT-mediated dUTP-biotin nick-end labeling ( TUNEL ) method . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ( GR ) expression of cultured murine ORNs was observed among ORNs at the mature stage . Expression of GRs by murine OE was localized on mature ORNs and supporting cells . Administration of GC to both cultured ORNs and mice resulted in proportions of apoptotic cells that were significantly higher than those in the control groups .</div>

 for the treatment of primary myelofibrosis . PURPOSE : The pharmacology , pharmacokinetics , pharmacogenomics , clinical efficacy , and safety profile of ruxolitinib for the treatment of primary myelofibrosis are reviewed . SUMMARY : 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , an oral tyrosine kinase inhibitor that targets the Janus-associated kinases ( JAKs ) 1 and 2 , has been recently approved for the treatment of patients with intermediate - or high-risk myelofibrosis . Unlike previous treatment options for patients with myelofibrosis , ruxolitinib offers a targeted therapy option for these patients who often suffer with severe and debilitating symptoms associated with the disease process . After oral administration , ruxolitinib is rapidly absorbed and can be given without regard to meals . 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08877

 is primarily metabolized by the cytochrome P - 450 ( CYP ) 3A4 isoenzyme system ; therefore , if concomitant use with a strong 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 inhibitor is unavoidable , an initial dosage reduction is warranted . Two Phase III randomized trials comparing ruxolitinib to either placebo or best available therapy found a rapid and sustained response in the reduction of spleen size and improvements in constitutional symptoms and quality of life , with one study demonstrating an improvement in overall survival . The most commonly reported serious adverse effects of ruxolitinib are anemia and thrombocytopenia .

 is administered as an oral tablet given twice daily , with the initial starting dosage based on the baseline platelet count . Dosage reductions are based on the development of thrombocytopenia . CONCLUSION : By directly targeting both

 and

 through small-molecule inhibition , ruxolitinib elicits a reduction in splenomegaly and disease-related symptoms in patients with intermediate - or high-risk myelofibrosis while maintaining an acceptable toxicity profile and a low treatment-discontinuation rate .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Sequencing a mouse acute promyelocytic leukemia genome reveals genetic events relevant for disease progression . Acute promyelocytic leukemia ( APL ) is a subtype of acute myeloid leukemia ( AML ) . It is characterized by the t ( 15 ; 17 ) ( q22 ; q11 . 2 ) chromosomal translocation that creates the promyelocytic leukemia-retinoic acid receptor  (

 , causing a rapidly fatal leukemia in mice . We also discovered a somatic 150 - kb deletion involving the lysine ( K ) - specific demethylase 6A ( Kdm 6a , also known as Utx ) gene , in the mouse APL genome . Similar deletions were observed in 3 out of 14 additional mouse APL samples and 1 out of 150 human AML samples . In conclusion , whole genome sequencing of mouse cancer genomes can provide an unbiased and comprehensive approach for discovering functionally relevant mutations that are also present in human leukemias .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">The heme oxygenase system rescues hepatic deterioration in the condition of obesity co-morbid with type - 2 diabetes . The prevalence of non-alcoholic fatty-liver disease ( NAFLD ) is increasing globally . NAFLD is a spectrum of related liver diseases that progressive from simple steatosis to serious complications like cirrhosis . The major pathophysiological driving of NAFLD includes elevated hepatic adiposity , increased hepatic triglycerides / cholesterol , excessive hepatic inflammation , and hepatocyte ballooning injury is a common histo-pathological denominator . Although heme-oxygenase ( HO ) is cytoprotective , its effects on hepatocyte ballooning injury have not been reported . We investigated the effects of upregulating HO with hemin or inhibiting it with stannous-mesoporphyrin (
